Custom CSS:
.board {
padding: 1px 2px;
}
div.post div.postInfo{
width:500px;
}
.indent-replies #unread-line, .indent-replies .thread > .replyContainer, .indent-replies .threadContainer > .replyContainer{
border-bottom:1px solid rgba(222,158,78,0.1);
margin-left:10px;
margin-top:3px;
}
#post-preview, .postMessage{
margin:5px 10px !important;
}
.rice {
display:none;
box-shadow:rgba(69,70,71,.3) 0 1px;
}
input[type=password]:hover,
input[type=text]:not([disabled]):hover,
input#fs_search:hover,
input.field:hover,
textarea:hover,
#options input:not([type=checkbox]):hover {
  box-shadow:inset rgba(0,0,0,.2) 0 1px 2px;
}
input[type=password]:focus,
input[type=text]:focus,
input#fs_search:focus,
input.field:focus,
textarea:focus,
#options input:focus {
  box-shadow:inset rgba(0,0,0,.2) 0 1px 2px;
}
button,
input,
textarea,
.rice {
  transition:background .2s,box-shadow .2s;
}
#thread-watcher{
  display:none;
}

#header-bar, .pagelist{
  background: #1d1f21;
  border: #1d1f21;
}

.sidebar-location-right #shortcuts{
  right: 20px !important;
}

#index-menu .selectrice{
  line-height: 18px;
  text-align: center;
  margin-left: 10px;
  margin-top: 10px;
}

#index-menu{
  margin-bottom: 10px;
}
